  const [users, setUsers] = useState([]);

  console.log('teste');

  useEffect(() => {
    fetch("https://5e7d0266a917d70016684219.mockapi.io/api/v1/users")
      .then((response) => response.json())
      .then((users) => {
        console.log(users)
        setUsers(users)
      });
  }, []);

  return (
    <div className="container">
    </div>
  );
};

export default UsersRoute;
